import React from 'react';
import Result from './Result';

function Results({results,message}){
    if(results.length===0){
        return(
            <div class="movies">
                <h2>Getting movies info, please wait or refresh</h2>
            </div>
        )
    }
    else{
        return(
            <div class="movies">
                {results.map(result=>(
                    <Result key={result.name} result={result}/>
                ))}
            </div>
        )
    }
}

export default Results;
